/* eslint-disable react/jsx-pascal-case */
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";


import Navegacion from '../componentes/Navegacion'
import Contenido_Inicio from '../componentes/Contenido_Inicio'
import Contenido_Sistema from '../componentes/Contenido_Sistema'

class Nav extends React.Component {
  render() {
    return (
      <Router>
        <div>
          <Navegacion />
          <Routes>
            <Route exact path='/Inicio' element={<Contenido_Inicio />} />
            <Route exact path='/Sistema' element={<Contenido_Sistema />} />
          </Routes>
        </div>
      </Router>
    )
  }
}
export default Nav;
